import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';

import Home from './components/pages/Home';

function App() {
  return (
    <Router>
      <ul>
        <li>Home</li>
        <li>Venda na Next Level</li>
        <li>Ofertas do Dia</li>
        <li>Celulares</li>
        <li>Tv e Vídeo</li>
        <li>Informática</li>
      </ul>

      <Routes>
        <Route exact path='/'>
          <Home/>
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
